  return (
    <Jumbo fluid className="jumbo-basic">
      <div className="overlay"></div>
      <Container>
        <h1>Contact</h1>
        <p>We'd love to hear from you</p>

        <div className="breadcrumbs">
          <Breadcrumbs separator="â€º" aria-label="breadcrumb">
            <Link to="/">
              Home
            </Link>
            <Typography>Contact</Typography>
          </Breadcrumbs>
        </div>
      </Container>
    </Jumbo>
  );
};

